import React from 'react'
import Sidebar from './Sidebar'

const Unsilenced = ({map}) => {

    if(map){
        map.flyTo({
            center: [-105.43647766113281, 37.41816326969145],
            zoom: 12,
            speed: 1,
            padding: {left: 500 },
        });
    }



    return (
        <div>
            <Sidebar />
        </div>
    )
}

export default Unsilenced
